import React from 'react'
import VehicleTable from './VehicleTable';
import audi1 from '../Assets/audi1.jpg';
import vwgolf1 from '../Assets/vwgolf1.jpg';
import Button from '@mui/material/Button';
import {useState} from 'react'


const VehicleModel = () => {

    let [imageChange, setImageChange] = useState(audi1)

    return (
        <div style={{display:"flex", flexDirection:"Column"}}>
            <p style={{display:"flex", flexDirection:"Column"}}>
                <span style={{fontWeight:"bold", fontSize:"25px", fontFamily:"helvertica", marginLeft:"auto", marginRight:"auto"}}>Vehicle Models</span>
                <span style={{fontWeight:"bold", fontSize:"40px", fontFamily:"helvertica",marginLeft:"auto", marginRight:"auto"}}>Our rental fleet</span>
                <span style={{color:"grey", marginLeft:"auto", marginRight:"auto"}}>Choose from a variety of our amazing vehicles to rent for your next<br></br> 
                adventure or business trip</span>
            </p>
            <div style={{display:"flex",flexDirection:"row",  marginLeft:"20%", marginRight:"20%", marginTop:"5%"}}>
                <div style={{display:"flex",flexDirection:"column"}}>
                    <Button variant="contained" style={{margin:"2%"}} onClick={()=>setImageChange(vwgolf1)}>Audi A1 S-Line</Button>
                    <Button variant="contained" style={{margin:"2%"}} onClick={()=>setImageChange(vwgolf1)}>VW Golf 6</Button>
                    <Button variant="contained" style={{margin:"2%"}} onClick={()=>setImageChange(vwgolf1)}>Toyota Camry</Button>
                    <Button variant="contained" style={{margin:"2%"}} onClick={()=>setImageChange(vwgolf1)}>BMW 320 ModernLine</Button>
                    <Button variant="contained" style={{margin:"2%"}} onClick={()=>setImageChange(vwgolf1)}>Mercedes Benz GLK</Button>
                    <Button variant="contained" style={{margin:"2%"}} onClick={()=>setImageChange(vwgolf1)}>VW Passat CC</Button>
                </div>
                <img src = {imageChange} alt='' style={{margin:"10%", width:"50%"}}></img>
                <VehicleTable style={{padding:"auto"}} />
            </div>
        </div>
    )
}
export default VehicleModel;
